INSERT INTO `ems_quotes` (`quote_id`, `quote`) VALUES
(1, 'You should spend your time/resources on experiences (by travelling), not on things.'),
(2, 'Though no one can go back & make a brand new start, anyone can start from now & make a brand new ending.'),
(3, 'Your goal should be to build a life, you don''t need a vacation from.'),
(4, 'You can''t have a million dollar dream with a minimum wage work ethic.'),
(5, 'If you don''t want anyone to find out, DON''T  DO IT.'),
(6, 'Create a Life that feels good on the inside NOT one that just looks good on the outside.'),
(7, 'A flower does not think of competing with the flower next to it, it just blooms. '),
(8, 'Right now, someone far less qualified than you is living your dreams. All because they didn''t just talk but took action.'),
(9, 'Take care of your thoughts when you are alone & take care of your words when you are with people.'),
(10, 'Don''t think about what can happen in a month or a year. Just focus on the 24 Hours & do what you can to get closer to where you want to be.'),
(11, 'Judge nothing, you''ll be happy. Forgive everything, you will be happier. Love everything, you''ll be happiest.'),
(12, 'Be careful with your words. Once they are said, they can only be forgiven, not forgotten.'),
(13, 'Anyone can be kind to someone they like. The real test is can you be kind to people you don''t like.'),
(14, 'Laziness feels good now, work hard feels good later.'),
(15, 'If you tell the truth every time, you don''t have to remember anything.'),
(16, 'The true test of a person''s character is what they do when no one is watching.'),
(17, 'It''s not the load that breaks you down, it''s the way you carry it.'),
(18, 'It''s not who you are underneath, but what you do that defines you.'),
(19, 'Luck is, what happens when preparation meets opportunity.'),
(20, 'An arrow can only be shot by pulling it backword. When life is dragging you back, focus & keep aiming. Life will launch you into something great.'),
(21, 'Once a year, go some place you''ve never been before.'),
(22, 'When you talk, you are only repeating what you know. But if you listen, you may learn something new. - The Dalai Lama'),
(23, 'Choose to have a life of "oh wells" rather than a life of "what ifs".																									'),
(24, 'To make a mistake is no mistake. Not to make a mistake may be a mistake. But to repeat a mistake is the biggest mistake! '),
(25, 'There is nothing in this world that can trouble you as much as your own thoughts.'),
(26, 'Keep choosing Happiness daily and happiness will keep choosing you back.'),
(27, 'Do what is right, even if no one is watching.'),
(28, 'Always, end the day with a positive thought, no matter how hard things were. Tomorrow is a fresh Opportunity to make it better.'),
(29, 'People don''t always need advice. Sometimes all they really need is a hand to hold, an ear to listen, and a heart to understand them.'),
(30, 'Speak in such a way that other love to listen to you. Listen in such a way others love to speak to you.'),
(31, 'If only our eyes saw souls instead of bodies, how very different our ideals of beauty would be.'),
(32, 'Don''t lose Hope. When The Sun gets down, The Stars come out.'),
(33, 'Die with Memories, not Dreams.'),
(34, 'Its not about Saying the good things, It all about doing the good things.'),
(35, 'Talent is God given. Be humble. Fame is man-given. Be grateful. Conceit (excessive pride) is self-given. Be careful.'),
(36, 'First Deserve, Then Desire.'),
(37, 'How to stop time : Meditate. How to travel in time : Read. How to escape time : Music. How to feel time : Write. How to waste time : Social Media.'),
(38, 'The journey from entitlement to reconciliation via disappointment is a journey that each aspirer would have to make for himself/herself.'),
(39, 'Before you talk, listen. Before you react, think. Before you criticise, wait. Before you pray, forgive. Before you quit, try.'),
(40, 'Before you speak, words are your slaves. But after you speak, you are a slave to your words. Choose your words wisely.'),
(41, 'A smooth Sea never made a skilful sailor.	'),
(42, 'Seeing a miracle will inspire you, but knowing you are a miracle will change you.	'),
(43, 'The man who does not read has no advantage over the man who can not read.'),
(44, 'Hard work beats Talent when Talent Doesn''t work hard.'),
(45, 'The best way to avoid disappointment is to not expect anything from Anyone.');
